import React, { useState, useEffect } from 'react';
import { View, Image, ImageBackground, Text, TouchableOpacity, Picker } from 'react-native';
import { RectButton, ScrollView, TextInput } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';
import { useRoute } from '@react-navigation/native';

import styles from './estilo';
import styleGeral from '../../estiloGeral/style'

export default function tCadastroLocalC() {

    const route = useRoute();

    const [nome, setnome] = useState(route.params?.nome || ''); //1
    const [sobrenome, setsobrenome] = useState(route.params?.sobrenome || ''); //2
    const [data_de_nasc, setdata_de_nasc] = useState(route.params?.data_de_nasc || '');//3
    const [cpf, setcpf] = useState(route.params?.cpf || ''); //4
    const [sexo, setsexo] = useState(route.params?.sexo || ''); //5
    const [celular, setcelular] = useState(route.params?.celular || '');//6
    const [email, setemail] = useState(route.params?.email || '');//7
    const [senha, setsenha] = useState(route.params?.senha || '');//8
    const [preco, setpreco] = useState(route.params?.preco || '');//8
    const [link, setlink] = useState(route.params?.link || '');//10

    const [cep, setCep] = useState("") //11
    const [logradouro, setLogradouro] = useState("") //12
    const [localidade, setLocalidade] = useState("")//13
    const [uf, setUf] = useState("")//14

    const [nEstado, setnEstado] = useState("")//14
    const Estado = [
        { label: 'Acre', value: 12 },
        { label: 'Alagoas', value: 27 },
        { label: 'Amapá', value: 16 },
        { label: 'Amazonas', value: 13 },
        { label: 'Bahia', value: 29 },
        { label: 'Ceará', value: 23 },
        { label: 'Distrito Federal', value: 53 },
        { label: 'Espírito Santo', value: 32 },
        { label: 'Goiás', value: 52 },
        { label: 'Maranhão', value: 21 },
        { label: 'Mato Grosso', value: 51 },
        { label: 'Mato Grosso do Sul', value: 50 },
        { label: 'Minas Gerais', value: 31 },
        { label: 'Pará', value: 15 },
        { label: 'Paraíba', value: 25 },
        { label: 'Paraná', value: 41 },
        { label: 'Pernambuco', value: 26 },
        { label: 'Piauí', value: 22 },
        { label: 'Rio de Janeiro', value: 33 },
        { label: 'Rio Grande do Norte', value: 24 },
        { label: 'Rio Grande do Sul', value: 43 },
        { label: 'Rondônia', value: 11 },
        { label: 'Roraima', value: 14 },
        { label: 'Santa Catarina', value: 42 },
        { label: 'São Paulo', value: 35 },
        { label: 'Sergipe', value: 28 },
        { label: 'Tocantins', value: 17 }
    ];

    const navigation = useNavigation();

    async function BuscarCep() {
        let url = `https://viacep.com.br/ws/${cep}/json/`;

        let req = await fetch(url);
        let res = await req.json();

        setLogradouro(res.logradouro);
        setLocalidade(res.localidade);
        setUf(getEstadoLabel(res.uf));
    }

    async function ListaEstados() {
        let url = `https://servicodados.ibge.gov.br/api/v1/localidades/estados/${nEstado}/municipios`;

        let req = await fetch(url);
        let res = await req.json();

        setLocalidade(res.nome);
    }

    function getEstadoLabel(sigla) {
        const estado = Estado.find((item) => item.value === sigla);
        return estado ? estado.label : '';
    }

    function Voltar() {
        navigation.goBack()
    }

    return (
        <ImageBackground style={styleGeral.container}>
            <View style={styles.marginTop}>
                <Image style={{ width: 100, height: 109, marginTop: -30 }}
                    source={require('../../../assets/logo.png')} />
            </View>

            <View>
                <Text style={styles.title}>Cadastro Usuário</Text>
            </View>

            <ScrollView>
                <View style={styles.footer}>

                    <TextInput
                        style={styles.input}
                        value={cep}
                        onChangeText={(texto) => setCep(texto)}
                        placeholder='Cep'
                    />

                    <TouchableOpacity style={styles.buttonNext}>
                        <Text style={styles.buttonText} onPress={BuscarCep}>Buscar</Text>
                    </TouchableOpacity>

                    <TextInput
                        style={styles.input}
                        value={uf}
                        onChangeText={(texto) => setUf(texto)}
                        placeholder='Estado'
                    />

                    <Picker
                        style={styles.input}
                        selectedValue={nEstado}
                        onValueChange={(itemValue) => setnEstado(itemValue)}
                    >
                        {Estado.map((opcao) => (
                            <Picker.Item
                                key={opcao.value}
                                label={opcao.label}
                                value={opcao.value}
                            />
                        ))}
                    </Picker>

                    <TextInput
                        style={styles.input}
                        value={localidade}
                        onChangeText={(texto) => setLocalidade(texto)}
                        placeholder="Cidade"
                    />

                    <TextInput
                        style={styles.input}
                        value={logradouro}
                        onChangeText={(texto) => setLogradouro(texto)}
                        placeholder="Endereço"
                    />

                </View>
            </ScrollView>

            <View>
                <RectButton style={styles.buttonNext} onPress={() => navigation.navigate('tCadastroFotoC', {
                    nome: nome, sobrenome: sobrenome, data_de_nasc: data_de_nasc, cpf: cpf, sexo: sexo, celular: celular, email: email, senha: senha, preco: preco, link: link, cep: cep, logradouro: logradouro, localidade: localidade, uf: uf,
                })}>
                    <Text style={styles.buttonText}>Avançar</Text>
                </RectButton>

                <RectButton style={styles.buttonReturn} onPress={Voltar}>
                    <Text style={styles.buttonText}>Voltar</Text>
                </RectButton>
            </View>
        </ImageBackground >
    );
}
